import styles from "./Footer.module.css";

export default function Footer() {
  return (
    <footer className={styles.footerArea}>
      <div
        style={{
          display: "flex",
          flexDirection: "column",
          justifyContent: "space-evenly",
        }}
      >
        <h2>NAVIGATION</h2>
        <p>Pricing</p>
        <p>Features</p>
        <p>Services</p>
        <p>F.A.Q</p>
        <p>News</p>
      </div>
      <div
        style={{
          display: "flex",
          flexDirection: "column",
          justifyContent: "space-evenly",
        }}
      ></div>
      <div
        style={{
          display: "flex",
          flexDirection: "column",
          justifyContent: "space-evenly",
        }}
      ></div>
      <div
        style={{
          display: "flex",
          flexDirection: "column",
          justifyContent: "space-evenly",
        }}
      ></div>
    </footer>
  );
}
